    "Sorry, there was an error parsing the subtitles that you uploaded. Please check the format and try again.": "\u0645\u062a\u0627\u0633\u0641\u06cc\u0645. \u062e\u0648\u0627\u0646\u062f\u0646 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0622\u067e\u0644\u0648\u062f \u06a9\u0631\u062f\u06cc\u062f \u0628\u0627 \u0645\u0634\u06a9\u0644 \u0645\u0648\u0627\u062c\u0647 \u0634\u062f. \u0644\u0637\u0641\u0627 \u0641\u0631\u0645\u062a\u0634\u0627\u0646 \u0631\u0627 \u06cc\u06a9 \u0628\u0627\u0631 \u062f\u06cc\u06af\u0631 \u0686\u06a9 \u06a9\u0646\u06cc\u062f \u0648 \u062f\u0648\u0628\u0627\u0631\u0647 \u0633\u0639\u06cc \u06a9\u0646\u06cc\u062f.", 
